Panics if the pattern doesn't match an `Effect` from the specified `Update`

Like in a `match` expression, the pattern can be optionally followed by `if`
and a guard expression that has access to names bound by the pattern.

# Example

```
# use crux_core::testing::Update;
# enum Effect { Render(String) };
# enum Event { None };
# let effects = vec![Effect::Render("test".to_string())].into_iter().collect();
# let mut update = Update { effects, events: vec!(Event::None) };
use crux_core::assert_effect;
assert_effect!(update, Effect::Render(_));
```

619.docs:
Allows Crux to construct app's set of required capabilities, providing context
they can then use to request effects and dispatch events.

`new_with_context` is called by Crux and should return an instance of the app's `Capabilities` type with
all capabilities constructed with context passed in. Use `Context::specialize` to
create an appropriate context instance with the effect constructor which should
wrap the requested operations.

Note that this implementation can be generated by the derive macro `crux_core::macros::Effect`.

```rust
# #[derive(Default)]
# struct App;
# pub enum Event {}
# #[allow(dead_code)]
# pub struct Capabilities {
#     http: crux_http::Http<Event>,
#     render: crux_core::render::Render<Event>,
# }
# pub enum Effect {
#     Http(crux_core::Request<<crux_http::Http<Event> as crux_core::capability::Capability<Event>>::Operation>),
#     Render(crux_core::Request<<crux_core::render::Render<Event> as crux_core::capability::Capability<Event>>::Operation>),
# }
# #[derive(serde::Serialize)]
# pub enum EffectFfi {
#     Http(<crux_http::Http<Event> as crux_core::capability::Capability<Event>>::Operation),
#     Render(<crux_core::render::Render<Event> as crux_core::capability::Capability<Event>>::Operation),
# }
# impl crux_core::App for App {
#     type Event = Event;
#     type Model = ();
#     type ViewModel = ();
#     type Capabilities = Capabilities;
#     type Effect = Effect;
#     fn update(&self, _event: Self::Event, _model: &mut Self::Model, _caps: &Self::Capabilities) -> crux_core::Command<Effect, Event> {
#         unimplemented!()
#     }
#     fn view(&self, _model: &Self::Model) -> Self::ViewModel {
#         unimplemented!()
#     }
# }
# impl crux_core::Effect for Effect {
#     type Ffi = EffectFfi;
#     fn serialize(self) -> (Self::Ffi, crux_core::bridge::ResolveSerialized) {
#         match self {
#             Effect::Http(request) => request.serialize(EffectFfi::Http),
#             Effect::Render(request) => request.serialize(EffectFfi::Render),
#         }
#     }
# }
impl crux_core::WithContext<Event, Effect> for Capabilities {
    fn new_with_context(
        context: crux_core::capability::ProtoContext<Effect, Event>,
    ) -> Capabilities {
        Capabilities {
            http: crux_http::Http::new(context.specialize(Effect::Http)),
            render: crux_core::render::Render::new(context.specialize(Effect::Render)),
        }
    }
}
```

738.docs:
Chain a [`StreamBuilder`] to run after completion of this [`RequestBuilder`],
passing the result to the provided closure `make_next_builder`.

The returned value of the closure must be a `StreamBuilder`, which
can represent some more work to be done before the composed future
is finished.

If you want to chain a request, use [`Self::then_request`] instead.

The closure `make_next_builder` is only run *after* successful completion
of the `self` future.

Note that this function consumes the receiving `RequestBuilder` and returns a
[`StreamBuilder`] that represents the composition.

# Example

```
# use crux_core::{Command, Request};
# use crux_core::capability::Operation;
# use serde::{Deserialize, Serialize};
# #[derive(Debug, PartialEq, Clone, Serialize, Deserialize)]
# enum AnOperation {
#     One,
#     Two,
#     More(u8),
# }
#
# #[derive(Debug, PartialEq, Deserialize)]
# enum AnOperationOutput {
#     One,
#     Two,
#     Other(u8),
# }
#
# impl Operation for AnOperation {
#     type Output = AnOperationOutput;
# }
#
# #[derive(Debug)]
# enum Effect {
#     AnEffect(Request<AnOperation>),
# }
#
# impl From<Request<AnOperation>> for Effect {
#     fn from(request: Request<AnOperation>) -> Self {
#         Self::AnEffect(request)
#     }
# }
#
# #[derive(Debug, PartialEq)]
# enum Event {
#     Completed(AnOperationOutput),
# }
let mut cmd: Command<Effect, Event> = Command::request_from_shell(AnOperation::More(1))
   .then_stream(|first| {
      let AnOperationOutput::Other(first) = first else {
         panic!("Invalid output!")
     };

     let second = first + 1;
     Command::stream_from_shell(AnOperation::More(second))
   })
   .then_send(Event::Completed);

let Effect::AnEffect(mut request) = cmd.effects().next().unwrap();
assert_eq!(request.operation, AnOperation::More(1));

request
  .resolve(AnOperationOutput::Other(1))
  .expect("to resolve");

let Effect::AnEffect(mut request) = cmd.effects().next().unwrap();
assert_eq!(request.operation, AnOperation::More(2));

